\begin{document}

Dear \textbf{Colleague},

\noindent I was taken aback when I recently witnessed your biracial marriage. The way you have been concealing it from the others is \underline{\textit{disguising}} the true meaning behind it. 

\noindent The \textit{\textbf{only} truth} that everyone needs to know about your marriage is that it is a beautiful representation of love.

\noindent I would like to end with a prayer: \\\textit{\\O Lord, please let everyone see beyond the disguise and truly understand the love that you and your partner share. \\ Amen}

\noindent Sincerely,

\[A Friend
